import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';

var dummy = "Fast";
var funky = "bowler";
var currenttime = new Date().toLocaleTimeString();
var currentdate =  new Date().toLocaleDateString();
var img1 ="https://picsum.photos/200/300";
var img2 ="https://picsum.photos/400/400";
var img3 ="https://picsum.photos/300/300";
ReactDOM.render(
   <>
    <h1 class="papa">{`Hello Mr. Shashwat ${dummy} ${funky}`}</h1>
   <p>current time = {currenttime}</p><p>current Date ={currentdate}</p>
   <img src={img1} alt="Random images"/>
   <img src={img2} alt="Random images"/>
   <a href="https://www.patentillustration.net" target= "_Papa">
   <img src={img3} alt="Random images"/>
   </a>
   </>
   ,document.getElementById("root")
);
